Defining Molt commands in Rust has been simplified. First, the Command trait has been removed. It was intended to provide a way to attach context data to a command; but it was not very good for mutable data, and had no way to share data among related commands (a common pattern). Second, the interpreter's context cache has been improved. Multiple commands can share a context ID (and hence access to the shared context); and the cached data will be dropped automatically when the last such command is removed from the interpreter. Third, there is now only one command function signature: fn my_command(interp: &mut Interp, context_id: ContextID, argv: &[Value]) -> MoltResult { ...
} Commands that don't use a cached context should be defined as follows: fn my_command(interp: &mut Interp, _: ContextID, argv: &[Value]) -> MoltResult { ...
}

