MoltResult is Molt's standard Result<T,E> type; it is defined as pub type MoltResult = Result<Value, ResultCode>; The Value type is described in the previous section ; by default, many Molt methods and functions return Value on success. The ResultCode is more complicated, as it is used to pass not only errors but also to manage control flow. It is defined as follows: #[derive(Eq, PartialEq, Clone, Debug)]
pub enum ResultCode { Error(Value), Return(Value), Break, Continue,
} In addition to a normal Ok result, a Molt function, method, or command can return: ResultCode::Error(msg) , where msg is an error message; this indicates that something has thrown an error. ResultCode::Return(value) , which indicates that the Molt code has called the return command; the value is the returned value. Molt procedures, defined using the proc command, will catch this and return value as the value of the procedure. ResultCode::Break and ResultCode::Continue are returned by the break and continue commands and control loop execution in the usual way.

