A normal CommandFunc is useful when extending the Molt language itself; but application-specific commands need to manipulate the application and its data. In this case, add the required data to the interpreter's context cache . The cached data can be retrieved, used, and mutated by commands tagged with the relevant context ID. The context cache is a hash map that allows the interpreter to keep arbitrary data and make it available to commands. The usual pattern is like this: The application defines a type containing the data the command (or commands) requires. We'll call it AppContext for the purpose of this example. The application saves an instance of AppContext into the context cache, retrieving a ContextID . The application includes the ContextID when adding the command to the interpreter. The command retrieves the AppContext as a mutable borrow. // The AppContext
struct AppContext { text: String } // The Command
fn cmd_whatsit(interp: &mut Interp, context_id: ContextID, argv: &[Value]) -> MoltResult { check_args(1, argv, 2, 2, "value")?; let ctx = interp.context::<AppContext>(context_id); // Append the first argument's string rep to the // AppContext struct's text field. ctx.text.push_str(argv[1].as_str()); molt_ok!()
} // Registering the command
fn main() { let interp = Interp::new(); let id = interp.save_context(AppContext::new()); interp.add_context_command("whatsit", cmd_whatsit, id); ...
} The saved AppContext will be dropped automatically if the whatsit command is removed from the interpreter.

