The molt::Interp::eval_body method is used when implementing control structures, as it gives access to the entire set of MoltResult return codes. use molt::Interp;
use molt::types::*; fn my_cmd(interp: &mut Interp, argv: &[Value]) -> MoltResult { // Get a Molt script to evaluate, e.g., a loop body: let body = argv[1]; ... // Assume we're implementing some kind of loop. loop { ... // Evaluate the loop body let result = interp.eval_body(body.as_str()); match result { Ok(value) => { // normal OK result. What you do with it depends on the // control structure. There's probably nothing special to do // here; we'll just go on with the next iteration of the loop. continue; } Err(ResultCode::Err(msg)) => { // An error. Control structures should usually let this // propagate. return result; } Err(ResultCode::Return(value)) => { // The code called the `return` command. Let this propagate to // return from the enclosing `proc`. return result; } Err(ResultCode::Break) => { // The code called the `break` command. If this function is // implementing a loop, it should return `Ok` to break out of // the loop; otherwise, let the `Break` propagate to break out // of the enclosing loop. Since this is a loop, // break and return `Ok' break; } Err(ResultCode::Continue) => { // The code called the `continue` command. If this function is // implementing a loop, this should continue on to the next // iteration of the loop after doing any necessary clean-up. // Otherwise, let it propagate to continue in the enclosing loop. // Here, we're implementing a loop. continue; } } ... } ... // It's a loop, which normally returns an empty result. molt_ok!()
} See The MoltResult Type for more information. The explicit Value type declaration is included for clarity.

